import React,{useState} from 'react'
import Square from './Square'
const Board = () => {

    const rendersquare=()=>{
        return(
            <Square />
        )
    }
    return (
        <div className="Board">
         <div className="Board-row">{<Square/>}{<Square/>}{<Square/>}</div>    
         <div className="Board-row">{<Square/>}{<Square/>}{<Square/>}</div> 
         <div className="Board-row">{<Square/>}{<Square/>}{<Square/>}</div> 
        </div>
    )
}

export default Board
